import styled from 'styled-components';



export const Icons = styled.img`
  width: 240px;
  height: 240px;
  align-self: stretch;
`;
export const Paragraph2 = styled.div`
  width: 228px;
  height: 75px;
  color: #828282;
  font-size: 16px;
  font-weight: 700;
  font-family: Oxygen;
  text-align: center;
`;
export const WhatWeDoDiv = styled.div`
  margin: 10rem;
  width: 1119px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`;
export const FlexColumn = styled.div`
  width: 306px;
  height: 900px;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: flex-end;
  margin: 0px 157px 0px 0px;
`;
export const Text1 = styled.div`
  align-self: flex-start;

  color: #1a6930;
  font-size: 3rem;
  font-weight: 700;
  font-family: Ubuntu;
  white-space: nowrap;
`;
export const Block = styled.div`
  width: 240px;
  gap: 25px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-end;
  margin: 0px 1px 92px 0px;
`;
export const Paragraph = styled.div`
  width: 228px;
  height: 60px;
  margin: 0px 5px 0px 0px;
  color: #828282;
  font-size: 16px;
  font-weight: 700;
  font-family: Oxygen;
  text-align: center;
  white-space: pre-wrap;
`;
export const Block3 = styled.div`
  width: 240px;
  gap: 13px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;
export const Paragraph1 = styled.div`
  width: 228px;
  height: 75px;
  margin: 0px 0px 0px 5px;
  color: #828282;
  font-size: 16px;
  font-weight: 700;
  font-family: Oxygen;
  text-align: center;
`;
export const FlexColumn1 = styled.div`
  width: 244px;
  height: 818px;
  gap: 77px;
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  align-items: flex-start;
  margin: 0px 140px 0px 0px;
  padding: 41px 0px;
`;
export const Block1 = styled.div`
  width: 240px;
  gap: 12px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-self: flex-end;
  align-items: center;
`;
export const Block4 = styled.div`
  width: 240px;
  gap: 25px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-end;
`;
export const Paragraph3 = styled.div`
  width: 228px;
  height: 75px;
  margin: 0px 4px 0px 0px;
  color: #828282;
  font-size: 16px;
  font-weight: 700;
  font-family: Oxygen;
  text-align: center;
`;
export const FlexColumn2 = styled.div`
  width: 272px;
  height: 900px;
  gap: 120px;
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  align-items: flex-end;
`;
export const Block2 = styled.div`
  width: 240px;
  gap: 10px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin: 0px 14px 0px 0px;
`;
export const Block5 = styled.div`
  width: 272px;
  gap: 20px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-self: stretch;
  align-items: center;
`;
export const Website = styled.img`
  width: 240px;
  height: 240px;
`;
export const Paragraph5 = styled.div`
  width: 272px;
  height: 114px;
  align-self: stretch;
  color: #828282;
  font-size: 16px;
  font-weight: 700;
  font-family: Oxygen;
  text-align: center;
`;
